    <Layout>
      <Container>
        <Row style={{ marginTop: "50px" }}>
          <Col md={{ span: 6, offset: 3 }}>
            <Form>
              <Input
                label="Enter email"
                type="email"
                placeholder="Enter your email"
                onChange={() => {}}
                value=""
              />
              <Input
                label="Enter email"
                type="email"
                placeholder="Enter your email"
                onChange={() => {}}
                value=""
              />
              <Form.Group controlId="formBasicCheckbox">
                <Form.Check type="checkbox" label="Check me out" />
